import React, { Component } from 'react';
import Link from 'next/link';

// Components
import Search from '../Search';
import Logo from '../Logo';

// Style
import { Container, Content, BackDrop, Header } from './styles';

// Icons
import { MdClose } from 'react-icons/md';

const MobileModal = props => {
	return (
		<Container>
			<BackDrop onClick={() => props.handleMobileModal()} />
			<Content>
				<Search />
				<Header>
					<MdClose size={25} />
					<Logo />
				</Header>
				<Link href="/">
					<a>Login</a>
				</Link>
				<Link href="/">
					<a>Store</a>
				</Link>
				<Link href="/">
					<a>Library</a>
				</Link>
				<Link href="/">
					<a>Community</a>
				</Link>
				<Link href="/">
					<a>Support</a>
				</Link>
			</Content>
		</Container>
	);
};

export default MobileModal;
